import './admin_page.css';
import UserHomeLayout from '../../layout/UserHomeLayout';
import axios from 'axios';
import { useDispatch } from 'react-redux';
import { getAllStudents } from '../../action/student/studentAction'
import { LoadAllAdminData } from './LoadAllDataAdmin';


import React, { Component } from 'react';

class AdminPage extends Component {
    
    componentDidMount() {
        axios.get("http://localhost")
    }

    render() {
        return (
            <div className="">
                <LoadAllAdminData />
                <Header
                    type="ADMIN"
                    user={user} />
                {user ? <UserHomeLayout user={user} type="ADMIN" /> : <h3>{message}</h3>}
            </div>
        );
    }
}

export default AdminPage;
